// src/HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    
    <div>
      <h1>Welcome to My Portfolio</h1>
      <img src="path/to/your/picture.jpg" alt="Iuliia Obukhova" />
      <p>Hello, I'm Iuliia Obukhova, a Full Stack Web Developer specializing in Three.js. Welcome to my portfolio.</p>
      <nav>
        <ul>
          <li><Link to="/project1">Project 1</Link></li>
          <li><Link to="/project2">Project 2</Link></li>
          <li><Link to="/contact">Contact Me</Link></li>
        </ul>
      </nav>
    </div>
  );
};

export default HomePage;
